import reactIcon from "../icons/react.png"
import angularIcon from "../icons/angular.png"

const Technologies = () => {

    return (
        <div className='topicInfo'>
            <Card className='techCard'>
                {/* <Box sx={{ display: 'flex', flexDirection: 'column' }}>
