                <img
                    src={reactIcon}
                    alt="react icon"
                />
            </Card>

            <Card className='techCard'>
                {/* <Box sx={{ display: 'flex', flexDirection: 'column' }}>
                    <CardContent sx={{ flex: '1 0 auto' }}>
                        <Typography component="div" variant="h4">
                            Angular
                        </Typography>
                    </CardContent>
                </Box> */}
                <img
                    src={angularIcon}
                    alt="angular icon"
                />
            </Card>


        </div>
    );
};

export default Technologies;
